svg.script:
   
	var myMapApp = new mapApp(false, undefined); //与tooltip相关
var obc; //
var ocls;
window.onSVGLoad = initLater();
function initLater() {
    //this timeout is because of the bbox bug in Firefox which prevents to have access to bbox in onload scripts
    window.setTimeout("init()", 100);
}
function init() {

    /* 添加tooltip*/
    //tooltip styles
    var tooltipTextStyles = {
        "font-family": "Arial,Helvetica",
        "fill": "dimgray",
        "font-size": 1300
    };
    var tooltipRectStyles = {
        "fill": "white",
        "stroke": "dimgray"
    };
    myMapApp.initTooltips("toolTip", tooltipTextStyles, tooltipRectStyles, 10, 20, 3);
    //add tooltip to element
    myMapApp.addTooltip("lunkuo", undefined, true, false, "target", "name");
	
	var layer_1=document.getElementById("lunkuo");
		var childa = layer_1.firstChild;
		while (childa != null) {
				childa.addEventListener("mouseover", Hightlight, false);
				childa.addEventListener("mouseout", Recover, false);	
				childa = childa.nextSibling;
			}

}
var xlinkNS = "http://www.w3.org/1999/xlink";
var someLinks = "../lasa.htm";
function OpenNewWindow() {

    window.open(someLinks, "newwindow", 'width=615,height=520,toolbar=no,location=no,top=200,left=300,directories=no,center:yes;status=yes,menubar=no,scrollbars=no,resizable=no');

}
function alternativeOpenWindow(evt, url) {
    evt.target.parentNode.setAttributeNS(xlinkNS, "href", url);
}
function LevelHighlight(evt) {
    var obj = evt.target;
    var posx, posy, curtrans, ctx, cty;
    posx = evt.clientX;
    posy = evt.clientY;
    document.getElementById("img1").setAttribute("x", posx * WAmp + vbCX);
    document.getElementById("img1").setAttribute("y", posy * HAmp + vbCY);
    document.getElementById("img1").setAttribute("style", "visibility: visible");

}
//鼠标移开后恢复
function Levelrecover(evt) {
    var obj = evt.target;
    document.getElementById("img1").setAttribute("style", "visibility: hidden");
}
function Hightlight(evt)
			{ 
			var object = evt.target;  
            obc=object.style.fill;
	 	    object.setAttribute("style", "fill: #33FFFF");
			var cls=object.getAttribute("class")||object.className;
			objectMap=svgDoc.getElementById(cls);
			objectMap.setAttribute("style", "fill: #33FFFF");
			objectMap.setAttribute("fill-opacity","0.8");
			} 
			function Recover(evt)
			{
	        var obj = evt.target;            
			obj.style.fill=obc;
	        objectMap.setAttribute("style", "fill: #FCE5CE");
	        objectMap.setAttribute("fill-opacity","0");
			}
 function closeinfotip(n)
	{
	document.getElementById('infotip'+n).setAttribute("style","visibility:hidden");
	}
